import java.util.*;

public class FirstUniqueCharacterInString {

    /*
    Given a string s, find the first non-repeating character in it and return its index. If it does not exist, return -1.
    Example 1:
        Input: s = "leetcode"
        Output: 0
    Example 2:
        Input: s = "loveleetcode"
        Output: 2
    Example 3:
        Input: s = "aabb"
        Output: -1
    Constraints:
        1 <= s.length <= 10^5
        s consists of only lowercase English letters.
     */


    // 4 ms, faster than 95.59% & 42.4 MB, less than 98.31%
    public static int firstUniqChar1(String s) {

        int[] charCount = new int[26];
        char[] chars = s.toCharArray();
        for (char each : chars) {
            charCount[each - 'a']++;
        }

        for (int i = 0; i < chars.length; i++) {
            if (charCount[chars[i] - 'a'] == 1) {
                return i;
            }
        }
        return -1;
    }


    // 23 ms, faster than 57.82% & 42.6 MB, less than 94.26%
    public static int firstUniqChar2(String s) {

        for (int i = 0; i < s.length(); i++) {
            if (s.indexOf(s.charAt(i)) == s.lastIndexOf(s.charAt(i))) {
                return i;
            }
        }
        return -1;
    }


    // Time Limit Exceeded when big amount of data is given
    public static int firstUniqChar3(String s) {

        List<Character> list = new ArrayList<>();

        for (int i = 0; i < s.length(); i++) {
            list.add(s.charAt(i));
        }

        for (int i = 0; i < list.size(); i++) {
            if (Collections.frequency(list, list.get(i)) == 1) {
                return i;
            }
        }
        return -1;
    }


    // Time Limit Exceeded when big amount of data is given
    public static int firstUniqChar4(String s) {

        if (s == null || s.length() > Math.pow(10, 5)) {
            return -1;
        }

        for (int i = 0; i < s.length(); i++) {
            int count = 0;
            for (int j = 0; j < s.length(); j++) {
                if (s.charAt(i) == s.charAt(j)) {
                    count++;
                }
            }
            if (count == 1) {
                return s.indexOf(s.charAt(i));
            }
        }
        return -1;
    }


    public static void main(String[] args) {
        System.out.println(firstUniqChar3(""));
    }

}
